import React from 'react';
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import { Register } from './pages/user/Register'
import { Login } from './pages/user/Login'
import { Home } from './pages/startpage/Homepage'
import {BookingRouter } from './pages/booking/BookingRouter'
import { Header } from './pages/frame/Header';
import { Footer } from './pages/frame/footer';
import { AdminPage } from './pages/admin/AdminPage';
import { ThemeProvider, createMuiTheme } from '@material-ui/core';
import { LoadingAnimation } from './pages/elements/LoadingAnimation';

interface Props {
  serverConnected: boolean
}


export const Routes: React.FC<Props> = (props) => {


  const theme = createMuiTheme({
    palette: {
      primary: {
        main: '#4caf50'
      },
      secondary: {
        main: '#f57c00'
      },
    },
  });

  const content = () => {
    if(props.serverConnected){
      return (
        <Switch>
        <Route exact path="/" component={Home}></Route>
        <Route exact path="/register" component={Register}></Route>
        <Route exact path="/login" component={Login}></Route>
        <Route exact path="/booking" component={BookingRouter}></Route>
        <Route exact path="/admin" component={AdminPage}></Route>
        <Route exact path="/admin/addlocation" component={AdminPage}></Route>
      </Switch>
      )
    } 

    return ( <LoadingAnimation />)

  }


   return (<BrowserRouter>
   <ThemeProvider theme={theme}>
    <div>
      <Header />     
        {content}
      <Footer />
    </div>
    </ThemeProvider>
   </BrowserRouter>);
}
